description:
One of the greatest Battles on U/S mats. Lightweight Title Bout!!!!

Sep 10, 2013 - Performers: Syd Blakovich  and  Cheyenne Jewel 


WMV only. MP4 + Pics later.


Syd Blakovich

&quot;The Nightmare&quot; 
Height:  5'2&quot; 
Weight:  120lbs 
Season W/L:  (2 - 0)  
Lifetime W/L:  (17 - 3)  


Cheyenne Jewel

&quot;The Wrangler &quot; 
Height:  5'5&quot; 
Weight:  127lbs 
Season W/L:  (4 - 0)  
Lifetime W/L:  (7 - 1)  


Cheyenne Jewel beat one of U/S's best and brightest stars, Darling (The Grappler) to earn her spot in the finals for the LightWeight title. Syd Blakovich has been on a 5 year hiatus but quickly reminded fans of her champion caliber skills in her match up with Wenona as well as in some of this season's tag matches. 

Cheyenne and Syd had a brief encounter with each other during a tag team match up ( see match 30783) Seeing Cheyenne hold her own against Syd in this tag match left the fans craving a full match between these two. Today Fans get their wish to come true in this amazing lightweight title fight. This is the Lightweight bout that was shot LIVE on July 17th. This is NOT a summer Vengeance match. It is highly likely these two could meet in the summer Vengeance finals for a rematch if Syd can get pass Sophia Fiore. IF that happens it will not be for the lightweight belt, it will be for the summer vengeance championship. If Cheyenne wins SV10 we could see cheyenne vs. Syd III for the light weight belt very early on in Season 11. 

There is so much heart and soul in the match. Syd refuses to lose. She's a former Champion and a legitimate Brown Belt in the art of Brazilian Jiu Jitsu. Losing today would be utterly humiliating. Cheyenne's got something to prove. Time and time again people keep underestimating her. She wants to show the world she can hang with &quot;THE ELITE&quot;. This battle is back and forth action up to the bitter end. When we streamed this match Live on July 17th 2013, twitter was blowing up with fans posting about the intensity of this match. This match is already marked by some fans as the greatest match ever released!

